import React from 'react';

export default function Header() {
  return (
    <header className="w-full flex items-center justify-center bg-black py-4 border-b border-gray-800">
      <img src="/logo.png" alt="SementalFit Logo" className="h-12 w-12 mr-3" style={{objectFit: 'contain'}} />
      <span className="text-2xl font-bold text-yellow-400 tracking-wide">SementalFit</span>
    </header>
  );
}
